import React from 'react';
import './App.css';
import Searchpage from './Searchpage'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/profile">
            {/* Render the profile page component */}
          </Route>
          <Route path="/signout">
            {/* Render the signout page component */}
          </Route>
          <Route path="/">
            <Searchpage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
